import React from "react";
import {BrowserRouter, NavLink} from 'react-router-dom';

const topTooltip = () => {
  return (
    <BrowserRouter>
    <ul className="top-tooltip">
      <li><NavLink to="/all" activeClassName='is-active' className="menu-font">all</NavLink></li>
      <li><NavLink to="/rings"activeClassName='is-active'  className="menu-font">rings</NavLink></li>
      <li><NavLink to="/necklaces" activeClassName='is-active' className="menu-font">necklaces</NavLink></li>
      <li><NavLink to="/bracelets" activeClassName='is-active' className="menu-font">bracelets</NavLink></li>
      <li><NavLink to="/earrings" activeClassName='is-active' className="menu-font">earrings</NavLink></li>
    </ul>
    </BrowserRouter>
  );
};

export default topTooltip;
